window.bookSummaryJSON = "<p><b>A century after the Martian war of independence, a group of kids is sent to Earth as delegates from Mars, but when they return home, they are caught between the two worlds, unable to reconcile the beauty and culture of Mars with their experiences on Earth in this \"thoughtful debut\" (</b><b><i>Kirkus Reviews</i></b><b>) from Hugo Award-winning author Hao Jingfang.</b></p> <p>This genre-bending novel is set on Earth in the wake of a second civil war...not between two factions in one nation, but two factions in one solar system: Mars and Earth. In an attempt to repair increasing tensions, the colonies of Mars send a group of young people to live on Earth to help reconcile humanity. But the group finds itself with no real home, no friends, and fractured allegiances as they struggle to find a sense of community and identity trapped between two worlds.</p>"; 
